class Provinces extends Realm.Object {}
Provinces.schema = {
    name: "Province",
    properties: {
        PROVINCE_ID: "number",
        PROVINCE_CODE: "string?",
        PROVINCE_NAME: "string",
        VALUE: "string",
        
    },
    primaryKey: " PROVINCE_ID",
};

export default new Realm({ schema: [Provinces] });
